INSERT INTO `v1_c7fe06fe6bf4350e190b74bd7a188dc29964c768a7edb4ff6d333b0483883c16` VALUES (3001100, -416.5, "ヤマト", "ミッションねえ……\nちょうどいいや\nどこまで片付けられるか\n賭けをしようじゃないか", 2, 1, 2.1, "2030/01/01 14:59:59", "2024/10/31 12:00:00", 0.0, 100, 3001, 130011);
INSERT INTO `v1_c7fe06fe6bf4350e190b74bd7a188dc29964c768a7edb4ff6d333b0483883c16` VALUES (3001101, -416.5, "ヤマト", "他人から言われた任務を\n言われるままにやるなんざ\n性に合わないんだがね……\nま、報酬は貰っとこうか", 2, 4, 5.68, "2030/01/01 14:59:59", "2024/10/31 12:00:00", 0.0, 101, 3001, 130011);
INSERT INTO `v1_c7fe06fe6bf4350e190b74bd7a188dc29964c768a7edb4ff6d333b0483883c16` VALUES (3001102, -416.5, "ヤマト", "なんだい？　やれンなら\nとっとと済ませちまいな。\nフブキが早くやることやれ\nってボヤいてたよ。", 1, 1, 0.0, "2030/01/01 14:59:59", "2024/10/31 12:00:00", 0.0, 102, 3001, 130011);
INSERT INTO `v1_c7fe06fe6bf4350e190b74bd7a188dc29964c768a7edb4ff6d333b0483883c16` VALUES (3002100, -416.5, "フブキ", "え～？　ぼくに頼みごと～？\nどうしちゃおっかな～\nちゃんとお願いできたら\n考えてあげよっかな～？", 1, 1, 0.0, "2030/01/01 14:59:59", "2024/10/31 12:00:00", 0.0, 100, 3002, 130211);
INSERT INTO `v1_c7fe06fe6bf4350e190b74bd7a188dc29964c768a7edb4ff6d333b0483883c16` VALUES (3002101, -416.5, "フブキ", "ほらほらぁ、これが\n欲しいんでしょ～？\nほんと、しょうがないよね～\nザコおに～いさん♡", 1, 1, 0.0, "2030/01/01 14:59:59", "2024/10/31 12:00:00", 0.0, 101, 3002, 130211);
INSERT INTO `v1_c7fe06fe6bf4350e190b74bd7a188dc29964c768a7edb4ff6d333b0483883c16` VALUES (3002102, -416.5, "フブキ", "へえ～、欲しいんだ～？\nぼくのた・い・せ・つ・な・モ・ノ\nあははっ！　なに考えてんの？\nもうへんふしじゃ～んｗ", 2, 5, 8.53, "2030/01/01 14:59:59", "2024/10/31 12:00:00", 0.0, 102, 3002, 130211);
INSERT INTO `v1_c7fe06fe6bf4350e190b74bd7a188dc29964c768a7edb4ff6d333b0483883c16` VALUES (3002103, -416.5, "フブキ", "なになに～？　もしかしてまた\nおねだりするつもりなんだ？\nとか言って、ほんとはぼくに\n会いたいだけだったりして～？", 1, 7, 5.67, "2030/01/01 14:59:59", "2024/10/31 12:00:00", 0.0, 103, 3002, 130211);
INSERT INTO `v1_c7fe06fe6bf4350e190b74bd7a188dc29964c768a7edb4ff6d333b0483883c16` VALUES (3002104, -416.5, "フブキ", "ザコお兄さんってぇ\n頼み方もワンパなのぉ～？\nもっと必死にならないと\nぼくの心は動かせないよ～？", 1, 1, 0.0, "2030/01/01 14:59:59", "2024/10/31 12:00:00", 0.0, 104, 3002, 130211);
INSERT INTO `v1_c7fe06fe6bf4350e190b74bd7a188dc29964c768a7edb4ff6d333b0483883c16` VALUES (3002300, -416.5, "フブキ", "あのさーザコお兄さん、\nな～んか調子乗ってない？\nぼくのこと、なんでもくれる\nチョロいやつとか思ってたりー？", 3, 3, 0.0, "2030/01/01 14:59:59", "2024/10/31 12:00:00", 0.0, 300, 3004, 130211);
INSERT INTO `v1_c7fe06fe6bf4350e190b74bd7a188dc29964c768a7edb4ff6d333b0483883c16` VALUES (3002400, -416.5, "フブキ", "ざんね～ん♪\nうざいお兄さんには、もうな～んにもあげませ～ん♡\nほんとなっさけなーい♪\nばいば～い♡", 7, 7, 0.0, "2030/01/01 14:59:59", "2024/10/31 12:00:00", 0.0, 301, 3005, 130211);
INSERT INTO `v1_c7fe06fe6bf4350e190b74bd7a188dc29964c768a7edb4ff6d333b0483883c16` VALUES (3003200, -416.5, "フブキ", "きゃはは、ほんと必死～♡\nは～、面白かった。\n笑えたからいいよ～\nそれ、恵んだげる～♪", 1, 2, 4.4, "2030/01/01 14:59:59", "2024/10/31 12:00:00", 0.0, 200, 3003, 130211);
INSERT INTO `v1_c7fe06fe6bf4350e190b74bd7a188dc29964c768a7edb4ff6d333b0483883c16` VALUES (3003201, -416.5, "フブキ", "は～、しょうがないな～♡\nザコお兄さんってば\nほんとよわよわで\n情けないよね～ｗ", 7, 7, 0.0, "2030/01/01 14:59:59", "2024/10/31 12:00:00", 0.0, 201, 3003, 130211);
